  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'client';
}
<nav>
  <a routerLink="/items">Item List</a> |
  <a routerLink="/create-item">Create Item</a>
</nav>
<hr />
